import React, { useState } from 'react';
import { Select } from 'antd';

export const SelectMenu = (props) => {
    const [value, setValue] = useState();

    const onChange = e => {
        console.log('selected', e.target.value);
        setValue(e.target.value);
      };

    return (
        <Select defaultValue={props.defaultValue} style={{ width: 120 }} onChange={onChange}>
            {props.options.map(({label, value}) => <Option value={value} key={value + '_' + label}>{label}</Option>)}
      </Select>
    );

}
